import React from 'react';

const User = ({ user }) => {
    return ( 
        <>
            <table className='.task-container'>
            <tr>
                <th>Company</th>
                <th>Contact</th>
                <th>Country</th>
            </tr>
            <tr>
                <td>Alfreds Futterkiste</td>
                <td>Maria Anders</td>
                <td>Germany</td>
            </tr>
            </table>
        </>
     );
}

export default User;
